    <section className="page">
      <div className=" h-screen flex w-screen justify-center items-center bg">
        <div className={`backdrop-blur-md h-screen w-screen $ p-4 rounded-lg relative `}>
          <h1 className="text-6xl white  ">Bienvenue à la Clinique du Diabète</h1>
          <p className="text-gray-200">La première clinique spécialisée dans La prise en charge du Diabète pluridisciplinaire en Mauritanie</p>
          <Link className="bg-blue-500 text-white p-2" to="/Contact">
            Contact Us
          </Link>
        </div>
      </div>
      <div className="h-screen w-screen bg-white z-10"></div>
    </section>
  );
}

